import { Link } from "react-router-dom";
import Logo from "../../assets/lightCubeLogo.png";
import { useState } from "react";

const Navigator = () => {
  const [navOpen, setNavOpen] = useState(true);

  return (
    <header className="fixed left-0 bottom-3 w-full px-12 text-center">
      <div className="bg-slate-900 inline-flex items-center justify-center p-1 border-2 w-auto min-w-[48px] border-slate-50 rounded-full">
        <button>
          <img src={Logo} alt="logo" className="w-8" />
        </button>
      </div>
    </header>
  );
};

export default Navigator;
